MODIFICA ALL’ART. 32 COSTITUZIONE IN MATERIA DI DIRITTO ALLA SALUTE;
MODIFICA ALL’ART. 75 COSTITUZIONE E ALLA LEGGE COSTITUZIONALE 25/05/1970 N.352 IN MATERIA DI REFERENDUM;
MODIFICA ALL’ART. 135 COSTITUZIONE IN MATERIA DI NOMINA DEI GIUDICI DELLA CORTE COSTITUZIONALE E FORMAZIONE DI ELENCHI.

Con le modifiche proposte l’Assemblea Costituente dei Cittadini  intende valorizzare e rendere effettivi i principi della sovranità popolare (art.1 Cost.) e della centralità dell’essere umano, che costituiscono i capisaldi della nostra Costituzione e rappresentano le fondamenta di una vera democrazia.

